import { Route, Routes , } from "react-router-dom";
import {Redirect } from "react-router-dom";
import Login from "./recursos/login";
import Registro from "./recursos/login/Registro";
import AddUser from "./recursos/produto/AddUser";
import EditUser from "./recursos/produto/EditUser";
import UserList from "./recursos/produto/UserList";


function App() {
  return (
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/regis" element={<Registro />} />
        <Route path="/add-user" element={<AddUser />} />
        <Route path="/" element={<UserList />} />
        <Route path="/edit-user/:id" element={<EditUser />} />
        <Redirect path="/" to="/login" />
      </Routes>

  );
}

export default App;
